import { StyleSheet } from 'react-native'

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: 'rgb(20, 20, 20)'
  },
  smallText: {
    fontSize: 40
  },
  largeText: {
    fontSize: 20
  },
  button: {
    marginTop: 10,
    padding: 5,
    borderRadius: 5,
    backgroundColor: 'white'
  }
});
